    uint256 public ServiceFee;
    // todo: not enabled
    address public ServiceFeeAddress;
    // Max Annual Rate or Monthly Interest Rate，Default is 100%
    uint256 public MaxFixedRate = 1e18;
    uint256 constant baseDecimal = 1e18;
    // Default is Base Years APR
    uint256 public baseYearOrMonth = 365 days;

    // lend info
    struct Lender {
        // approve address
        address Address;
        address Token;
        uint256 FixedRate;
        uint256 CreditLine;
        uint256 Amount;
        string Alias;
        // Whether to completely deauthorize
        bool isCancel;
    }

    // borrower info
    struct Borrower {
        address Creditors;
        address Token;
        uint256 FixedRate;
        uint256 CreditLine;
        uint256 Amount;
        string Alias;
        // Whether to completely deauthorize
        bool isCancel;
    }


    // total borrower info
    address[] public totalBorrower;
